import React, { useState, useEffect, ReactChild, ReactChildren, ReactNodeArray } from "react";

import { AssistentNavigation } from "./AssistentNavigation";

interface Props {
     children: ReactNodeArray
}

export const AssistentFlow: React.FC<Props> = (Props) => {

    const [step, setstep] = useState(0)

    const children = Props.children;

    const onNextClicked = () => {
        setstep(step + 1)
    }


   return (
       <div>
           <AssistentNavigation onNextStepp={onNextClicked} />
            {children[step]}
       </div> 
    )
}
